import SaphireRingImg from './saphire-ring.png';

const SaphireRing = {
  name: 'Saphire Ring',
  type: 'ring',
  effect: {
    defence: 10,
    hp: 15,
    mana: 10,
  },
  image: SaphireRingImg,
  value: 150,
};

export default SaphireRing;
